svg.script:

function animateDove(flaps){
    var frame1 = document.getElementById("doveWingsA"),
        frame2 = document.getElementById("doveWingsB"),
        frame3 = document.getElementById("doveWingsC"),
        frame4 = document.getElementById("doveWingsD"),
        frame5 = document.getElementById("doveWingsE"),
        frame6 = document.getElementById("doveWingsF"),
        frame7 = document.getElementById("doveWingsG"),
        frame8 = document.getElementById("doveWingsH"),
        frame9 = document.getElementById("doveWingsI"),
        motionFrames = [frame1, frame2, frame3, frame4, frame5, frame6, frame7, frame8, frame9, frame1],
        fs = 0;


    var frameRate = setInterval(function(){
            if (fs>0){
                motionFrames[fs-1].setAttribute("display", "none");
            };
            motionFrames[fs].setAttribute("display", "inline");
            fs++;

            if (fs === motionFrames.length){
                if(flaps>0){
                    fs=0;
                    flaps--;
                }
                else{
                    clearInterval(frameRate);
                }
            }
    }, 80);
}
